// @ts-nocheck
import React, { ReactNode, HTMLAttributes } from 'react';
import { createComponent } from '../lib';
import type { JSX } from '@vime/core/dist/types';

import { 
  VmUi 
} from '@vime/core';

import { define } from '../lib';


define('vm-ui', VmUi);


export interface UiProps extends JSX.VmUi, HTMLAttributes<HTMLVmUiElement> {
  children?: ReactNode | ReactNode[]
};

export default createComponent<HTMLVmUiElement, UiProps>(
  'vm-ui',
  new Set(['isVideoView','playsinline','isFullscreenActive']),
);
